// src/components/MenuBar.jsx
import { useState } from "react";
import { FaBars } from "react-icons/fa";

const MenuBar = () => {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <div className="relative">
      <button
        className="text-white p-3"
        onClick={() => setIsOpen(!isOpen)}
      >
        <FaBars size={20} />
      </button>
      {isOpen && (
        <div className="absolute top-12 left-0 bg-white shadow-lg rounded p-4 z-50 w-64">
          <ul className="space-y-3">
            <li className="hover:text-blue-600 cursor-pointer">Home</li>
            <li className="hover:text-blue-600 cursor-pointer">Orders</li>
            <li className="hover:text-blue-600 cursor-pointer">Invoices</li>
            <li className="hover:text-blue-600 cursor-pointer">Reports</li>
            <li className="hover:text-blue-600 cursor-pointer">Settings</li>
          </ul>
        </div>
      )}
    </div>
  );
};

export default MenuBar;
